import React, { useState } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./App.css";
import Lending from "../src/feature/lendingPage/components/lendingPage.jsx";
import HomePage from "../src/feature/homepage/components/home.jsx";
import GroupForm from "./feature/homepage/components/groupExpense";

const App = () => {
  const data = {
    groupName: "subway",
    paidByName: "you",
    amount: "1000",
    members: [
      { name: "You", amount: "200.00" },
      { name: "Om", amount: "200.00" },
      { name: "Sapna", amount: "200.00" },
      { name: "Shruti", amount: "200.00" },
      { name: "Shivani", amount: "200.00" },
    ],
  };

  

  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Lending />} />
          <Route path="/home" element={<HomePage />} />
          <Route
            path="/AddExpense"
            element={<GroupForm members={data.members}  />
            }
          />
        </Routes>
      </BrowserRouter>
    </>
  );
};

export default App;
